import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, { Lazy, Pagination } from 'swiper';
import 'swiper/swiper-bundle.css';
import slide1 from '../img/slider/slide1.webp';


function Slider() {
  return (
    <Swiper
      id="mySwiper"
      lazy={{ loadPrevNext: true, loadPrevNextAmount: 1 }}
      pagination={{ clickable: true }}
      slidesPerView={1}
      speed={1500}
      loop={true}
      cssMode={true}
    >
      <SwiperSlide lazy><img src={slide1} alt="Slider 1" loading="lazy"/></SwiperSlide>
      <SwiperSlide lazy><img src="../../img/slider/2.webp" alt="Slider 2" loading="lazy"/></SwiperSlide>
      <SwiperSlide lazy><img src="/img/slider/3.webp" alt="Slider 3" loading="lazy"/></SwiperSlide>
      <SwiperSlide lazy><img src="../img/slider/3.webp" alt="Slider 4" loading="lazy"/></SwiperSlide>
    </Swiper>
  )
}

export default Slider;
